import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const SpecialtyGridContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
  gap: 30px;
  margin: 40px 0;
  align-items: stretch;
  justify-items: center;
`;

const SpecialtyCard = styled(motion.div)`
  background: white;
  border: 1px solid #e2e8f0;
  border-radius: 12px;
  padding: 30px;
  text-align: center;
  transition: all 0.3s ease;
  width: 100%;
  box-shadow: 0 4px 15px rgba(0,0,0,0.05);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  min-height: 180px;
  cursor: pointer;

  &:hover {
    border-color: #1e3a8a;
    transform: translateY(-5px);
    box-shadow: 0 8px 25px rgba(0,0,0,0.1);
  }
`;

const SpecialtyName = styled.div`
  font-weight: 600;
  color: #1e3a8a;
  margin-bottom: 15px;
  font-size: 0.95rem;
`;

const SpecialtyPercentage = styled.div`
  font-size: 2rem;
  font-weight: 700;
  color: ${props => {
    if (props.type === 'decrease') return '#dc2626';
    if (props.type === 'stable') return '#d97706';
    return '#059669';
  }};
  margin-bottom: 10px;
`;

const SpecialtyChange = styled.div`
  font-size: 0.8rem;
  color: #64748b;
  text-transform: uppercase;
  letter-spacing: 0.5px;
  margin-bottom: 15px;
`;

const ProgressContainer = styled.div`
  margin: 20px 0 10px;
  width: 100%;
`;

const ProgressBar = styled.div`
  width: 100%;
  height: 10px;
  background: #e2e8f0;
  border-radius: 6px;
  overflow: hidden;
`;

const ProgressFill = styled(motion.div)`
  height: 100%;
  background: ${props => {
    if (props.type === 'decrease') return 'linear-gradient(90deg, #dc2626, #ef4444)';
    if (props.type === 'stable') return 'linear-gradient(90deg, #d97706, #f59e0b)';
    return 'linear-gradient(90deg, #1e3a8a, #3b82f6)';
  }};
  border-radius: 6px;
  width: 0%;
`;

const specialtyData = [
  {
    name: 'Nurse Practitioners',
    percentage: '26%',
    change: 'Major Decreases',
    type: 'decrease',
    width: 26
  },
  {
    name: 'Physician Associates',
    percentage: '24%',
    change: 'Major Increases',
    type: 'increase',
    width: 24
  },
  {
    name: 'Pediatricians',
    percentage: '70%',
    change: 'Stable Participation',
    type: 'stable',
    width: 70
  },
  {
    name: 'OB/GYN Specialists',
    percentage: '68%',
    change: 'Stable Participation',
    type: 'stable',
    width: 68
  }
];

const SpecialtyCardComponent = ({ specialty, index }) => {
  const [animated, setAnimated] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setAnimated(true), 500 + index * 200);
    return () => clearTimeout(timer);
  }, [index]);

  return (
    <SpecialtyCard
      initial={{ opacity: 0, y: 50 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6, delay: index * 0.1 }}
      whileHover={{ scale: 1.05 }}
    >
      <SpecialtyName>{specialty.name}</SpecialtyName>
      <SpecialtyPercentage type={specialty.type}>
        {specialty.percentage}
      </SpecialtyPercentage>
      <SpecialtyChange>{specialty.change}</SpecialtyChange>

      <ProgressContainer>
        <ProgressBar>
          <ProgressFill
            type={specialty.type}
            animate={{ width: animated ? `${specialty.width}%` : '0%' }}
            transition={{ duration: 1.5, ease: 'easeInOut', delay: 0.5 }}
          />
        </ProgressBar>
      </ProgressContainer>
    </SpecialtyCard>
  );
};

const SpecialtyGrid = () => {
  return (
    <SpecialtyGridContainer>
      {specialtyData.map((specialty, index) => (
        <SpecialtyCardComponent
          key={specialty.name}
          specialty={specialty}
          index={index}
        />
      ))}
    </SpecialtyGridContainer>
  );
};

export default SpecialtyGrid;
